import React, {useState} from 'react'


const VisionSystemConfPage = (props) => {

    return(
        <div id='panel' className="App-panel">
          <form>
            <label for="name">Name:</label>
            <input type="text" id="name" value="John Smith"/>
            <label for="email">Email:</label>
            <input type="text" id="email" value="john.smith@example.com"/>
            <label for="phone">Phone:</label>
            <input type="text" id="phone" value="555-555-5555"/>
            <label for="address">Address:</label>
            <input type="text" id="address" value="123 Main St"/>
            <label for="city">City:</label>
            <input type="text" id="city" value="New York"/>
            <label for="zip">Zip code:</label>
            <input type="text" id="zip" value="10001"/>
            <input type="submit" value="Submit"/>
          </form> 
        </div>
    );
};

export default VisionSystemConfPage;
